  import React from 'react';
  import { mdx } from '@mdx-js/react';

  export const frontMatter = {
	id: 'index-redistimeseries',
	title: 'RedisTimeSeries Tutorial',
	sidebar_label: 'RedisTimeSeries Tutorial',
	slug: '/howtos/redistimeseries'
};
export const metadata = {
  "unversionedId": "howtos/redistimeseries/index-redistimeseries",
  "id": "howtos/redistimeseries/index-redistimeseries",
  "isDocsHomePage": false,
  "title": "RedisTimeSeries Tutorial",
  "description": "RedisTimeseries is a Redis module developed by Redis Labs to enhance your experience managing time-series data with Redis. It simplifies the use of Redis for time-series use cases such as internet of things (IoT) data, stock prices, and telemetry. With RedisTimeSeries, you can ingest and query millions of samples and events at the speed of Redis. Advanced tooling such as downsampling and aggregation ensure a small memory footprint without impacting performance. Use a variety of queries for visualization and monitoring with built-in connectors to popular monitoring tools like Grafana, Prometheus, and Telegraf.",
  "source": "@site/docs/howtos/redistimeseries/index-redistimeseries.mdx",
  "slug": "/howtos/redistimeseries",
  "permalink": "/howtos/redistimeseries",
  "editUrl": "https://github.com/redis-developer/redis-developer/edit/master/docs/howtos/redistimeseries/index-redistimeseries.mdx",
  "version": "current",
  "sidebar_label": "RedisTimeSeries Tutorial",
  "sidebar": "docs",
  "previous": {
    "title": "How to store and retrieve JSON documents using NodeJS",
    "permalink": "/howtos/redisjson/storing-json-using-nodejs"
  },
  "next": {
    "title": "RedisGraph Tutorial",
    "permalink": "/howtos/redisgraph/"
  }
};
  /* @jsxRuntime classic */
/* @jsx mdx */

export const toc = [{
  value: 'Step 1. Register and subscribe',
  id: 'step-1-register-and-subscribe',
  children: []
}, {
  value: 'Step 2. Create a database with RedisTimeSeries Module',
  id: 'step-2-create-a-database-with-redistimeseries-module',
  children: []
}, {
  value: 'Step 3. Connect to a database',
  id: 'step-3-connect-to-a-database',
  children: []
}, {
  value: 'Step 4. Getting Started with RedisTimeSeries',
  id: 'step-4-getting-started-with-redistimeseries',
  children: []
}, {
  value: 'Next Step',
  id: 'next-step',
  children: []
}];

const layoutProps = {
  toc
};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <p><a parentName="p" {...{
        "href": "https://redis.com/modules/redis-timeseries/"
      }}>{`RedisTimeseries`}</a>{` is a Redis module developed by Redis Labs to enhance your experience managing time-series data with Redis. It simplifies the use of Redis for time-series use cases such as internet of things (IoT) data, stock prices, and telemetry. With RedisTimeSeries, you can ingest and query millions of samples and events at the speed of Redis. Advanced tooling such as downsampling and aggregation ensure a small memory footprint without impacting performance. Use a variety of queries for visualization and monitoring with built-in connectors to popular monitoring tools like Grafana, Prometheus, and Telegraf.`}</p>
    <div class="text--center">
      <iframe width="760" height="415" src="https://www.youtube.com/embed/nkUZqxjs2rk" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
    </div>
    <h3 {...{
      "id": "step-1-register-and-subscribe"
    }}>{`Step 1. Register and subscribe`}</h3>
    <p>{`Follow `}<a parentName="p" {...{
        "href": "/create/cloud/rediscloud"
      }}>{`this link to register`}</a>{` and subscribe to Redis Enterprise Cloud`}</p>
    <p><img alt={"Redistimeseries"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./redistimeseries.png").default} /></p>
    <h3 {...{
      "id": "step-2-create-a-database-with-redistimeseries-module"
    }}>{`Step 2. Create a database with RedisTimeSeries Module`}</h3>
    <p><img alt={"Redistimeseries"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./redistimeseries1.png").default} /></p>
    <h3 {...{
      "id": "step-3-connect-to-a-database"
    }}>{`Step 3. Connect to a database`}</h3>
    <p>{`Follow `}<a parentName="p" {...{
        "href": "explore/redisinsight"
      }}>{`this`}</a>{` link to know how to connect to a database`}</p>
    <h3 {...{
      "id": "step-4-getting-started-with-redistimeseries"
    }}>{`Step 4. Getting Started with RedisTimeSeries`}</h3>
    <p>{`This section will walk you through using some basic RedisTimeseries commands. You can run them from the Redis command-line interface (redis-cli) or use the CLI available in RedisInsight. (See part 2 of this tutorial to learn more about using the RedisInsight CLI.)
Using a basic air-quality dataset, we will show you how to:`}</p>
    <ul>
      <li parentName="ul">{`Create a new time series`}</li>
      <li parentName="ul">{`Add a new sample to the list of series`}</li>
      <li parentName="ul">{`Query a range across one or multiple time series`}</li>
    </ul>
    <p><img alt={"RedisTimeSeries"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./redistimeseriesflow.png").default} /></p>
    <h4 {...{
      "id": "create-a-new-time-series"
    }}>{`Create a new time series`}</h4>
    <p>{`Let’s create a time series representing air quality dataset measurements. To interact with RedisTimeSeries you will most often use the TS.RANGE command, but here you will create a time series per measurement using the TS.CREATE command. Once created, all the measurements will be sent using TS.ADD.`}</p>
    <p>{`The sample command below creates a time series and populates it with three entries:`}</p>
    <pre><code parentName="pre" {...{}}>{`>> TS.CREATE ts:carbon_monoxide
>> TS.CREATE ts:relative_humidity
>> TS.CREATE ts:temperature RETENTION 60 LABELS sensor_id 2 area_id 32
`}</code></pre>
    <p>{`In the above example, ts:carbon_monoxide, ts:relative_humidity and ts:temperature are key names. We are creating a time series with two labels (sensor_id and area_id are the fields with values 2 and 32 respectively) and a retention window of 60 milliseconds:`}</p>
    <h4 {...{
      "id": "add-a-new-sample-data-to-the-time-series"
    }}>{`Add a new sample data to the time series`}</h4>
    <p>{`Let’s start to add samples into the keys that will be automatically created using this command:`}</p>
    <pre><code parentName="pre" {...{}}>{`>> TS.ADD ts:carbon_monoxide 1112596200 2.4
>> TS.ADD ts:relative_humidity 1112596200 18.3
>> TS.ADD ts:temperature 1112599800 28.3
`}</code></pre>
    <pre><code parentName="pre" {...{}}>{`>> TS.ADD ts:carbon_monoxide 1112599800 2.1
>> TS.ADD ts:relative_humidity 1112599800 13.5
>> TS.ADD ts:temperature 1112603400 28.5 
`}</code></pre>
    <pre><code parentName="pre" {...{}}>{`>> TS.ADD ts:carbon_monoxide 1112603400 2.2
>> TS.ADD ts:relative_humidity 1112603400 13.1
>> TS.ADD ts:temperature 1112607000 28.7
`}</code></pre>
    <h4 {...{
      "id": "querying-the-sample"
    }}>{`Querying the sample`}</h4>
    <p>{`Now that you have sample data in your time series, you’re ready to ask questions such as:`}</p>
    <h4 {...{
      "id": "how-do-i-get-the-last-sample"
    }}>{`“How do I get the last sample?”`}</h4>
    <p>{`TS.GET is used to get the last sample. The returned array will contain the last sample timestamp followed by the last sample value, when the time series contains data:`}</p>
    <pre><code parentName="pre" {...{}}>{`>> TS.GET ts:temperature
1) (integer) 1112607000
2) "28.7"
`}</code></pre>
    <h4 {...{
      "id": "how-do-i-get-the-last-sample-matching-the-specific-filter"
    }}>{`“How do I get the last sample matching the specific filter?”`}</h4>
    <p>{`TS.MGET is used to get the last samples matching the specific filter:`}</p>
    <pre><code parentName="pre" {...{}}>{`>> TS.MGET FILTER area_id=32
1) 1) "ts:temperature"
   2) (empty list or set)
   3) 1) (integer) 1112607000
      2) "28.7"
`}</code></pre>
    <h4 {...{
      "id": "how-do-i-get-the-sample-with-labels-matching-the-specific-filter"
    }}>{`“How do I get the sample with labels matching the specific filter?”`}</h4>
    <pre><code parentName="pre" {...{}}>{`>> TS.MGET WITHLABELS FILTER area_id=32
1) 1) "ts:temperature"
   2) 1) 1) "sensor_id"
         2) "2"
      2) 1) "area_id"
         2) "32"
   3) 1) (integer) 1112607000
      2) "28.7"
`}</code></pre>
    <h4 {...{
      "id": "query-a-range-across-one-or-more-time-series"
    }}>{`Query a range across one or more time series`}</h4>
    <p>{`TS.RANGE is used to query a range in forward directions while TS.REVRANGE is used to query a range in reverse directions, They let you answer such questions as:`}</p>
    <h4 {...{
      "id": "how-do-i-get-the-sample-for-a-time-range"
    }}>{`“How do I get the sample for a time range?”`}</h4>
    <pre><code parentName="pre" {...{}}>{`>> TS.RANGE ts:carbon_monoxide 1112596200 1112603400
1) 1) (integer) 1112596200
   2) "2.4"
2) 1) (integer) 1112599800
   2) "2.1"
3) 1) (integer) 1112603400
   2) "2.2"
`}</code></pre>
    <h4 {...{
      "id": "aggregation"
    }}>{`Aggregation`}</h4>
    <p>{`You can use various aggregation types such as  avg, sum, min, max, range, count, first, last etc. The example below example shows how to use “avg” aggregation type to answer such questions as:`}</p>
    <h4 {...{
      "id": "how-do-i-get-the-sample-for-a-time-range-on-some-aggregation-rule"
    }}>{`“How do I get the sample for a time range on some aggregation rule?”`}</h4>
    <pre><code parentName="pre" {...{}}>{`>> TS.RANGE ts:carbon_monoxide 1112596200 1112603400 AGGREGATION avg 2
1) 1) (integer) 1112596200
   2) "2.4"
2) 1) (integer) 1112599800
   2) "2.1"
3) 1) (integer) 1112603400
   2) "2.2"
`}</code></pre>
    <h3 {...{
      "id": "next-step"
    }}>{`Next Step`}</h3>
    <ul>
      <li parentName="ul">{`Learn more about RedisTimeSeries in the `}<a parentName="li" {...{
          "href": "https://oss.redislabs.com/redistimeseries/"
        }}>{`Quickstart`}</a>{` tutorial.`}</li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://redislabs.com/blog/build-your-financial-application-on-redistimeseries/"
        }}>{`Build Your Financial Application on RedisTimeSeries`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://redislabs.com/blog/how-to-manage-real-time-iot-sensor-data-in-redis/"
        }}>{`How to Manage Real-Time IoT Sensor Data in Redis`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://www.youtube.com/watch?v=rXynFOrrd-Q"
        }}>{`Introduction to RedisTimeSeries - Video`}</a></li>
    </ul>
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
